import React from 'react';

const MyComponent = (props) => {
    return (
        <nav className="navbar navbar-default bg-dark fontify">
            <div className="navbar-header">  <i className=" big youtube icon red"/></div>
            <div>{props.children}</div>

        </nav>
    );
};

export default MyComponent;
